import React, { Component } from 'react';
import PropTypes from 'prop-types';
import './PhoneIdentification.css';
import './AttractLoop.css';



class PhoneNumberIdentification extends Component{
    constructor(props){
        super(props);
    }
    render(){

        return(
            <div>
            <div className="AttractLoop" >
               <header className="AttractLoop-Header">
                  <h1> Savings & Coupons</h1>
               </header>
        </div>  
        <div className="messsgeDisplay">
        <h3>Enter the Phone number associated with the account</h3>
        <div id="container">
        <ul id="keyboard">   
        <button class="letter">1</button>  
        <button class="letter">2</button>  
        <button class="letter">3</button>  
        <button class="letter clearl">4</button>  
        <button class="letter">5</button>  
        <button class="letter">6</button> 

        <li class="letter clearl">7</li>  
        <li class="letter ">8</li>  
        <li class="letter">9</li>  
        <li class="letter">0</li>
        <li class="switch">abc</li>  
         <li class="return">retur</li>
         <li class="delete lastitem"></li>  
        </ul>
        </div>

        </div>



     </div>
        );
    };

}


export default PhoneNumberIdentification;
